import React from 'react';
import { 
  Box, 
  Typography, 
  Grid, 
  Divider,
  Button
} from '@mui/material';
import { getPaybackStatus } from '../../utils/calculations';

// Helper function to format numbers with commas as thousands separators
const formatNumber = (num) => {
  if (typeof num === 'string') return num;
  return num.toLocaleString();
};

// Helper function to format JPY currency
const formatCurrency = (amount) => {
  return `JPY ${formatNumber(Math.round(amount))}`;
};

// Helper function to format percentage
const formatPercent = (value) => {
  return `${value.toFixed(2)}%`;
};

/**
 * Results Panel Component
 * Displays the calculated results
 */
const ResultsPanel = ({ results }) => {
  // Determine the background color based on payback period
  const paybackStatus = getPaybackStatus(results.paybackPeriod);

  // Set background color based on payback status
  const bgColors = {
    'good': '#D4EDDA',     // Green
    'average': '#FFF3CD',  // Yellow
    'warning': '#F8D7DA',  // Red
    'no-profit': '#E9ECEF' // Gray
  };

  const bgColor = bgColors[paybackStatus];

  return (
    <Box sx={{ backgroundColor: bgColor, p: 2, borderRadius: 1 }}>
      <Typography variant="h6" gutterBottom>
        Simulation Results
      </Typography>

      {/* Main financial metrics */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Monthly Sales</Typography>
          <Typography variant="h5" fontWeight="bold">
            {formatCurrency(results.monthlySales)}
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Monthly Gross Profit</Typography>
          <Typography variant="h5" fontWeight="bold">
            {formatCurrency(results.monthlyGrossProfit)}
          </Typography>
        </Grid>
      </Grid>

      <Divider sx={{ my: 2 }} />

      {/* Key metrics */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Gross Profit Margin</Typography>
          <Typography variant="body1" fontWeight="bold">
            {formatPercent(results.grossProfitMargin)}
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Investment Payback Period</Typography>
          <Typography variant="body1" fontWeight="bold">
            {results.paybackPeriod === '-' ? 'N/A' : `${results.paybackPeriod.toFixed(1)} months`}
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Cost per Unit</Typography>
          <Typography variant="body1" fontWeight="bold">
            {formatCurrency(results.costPerUnit)}
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Operating Hours (monthly)</Typography>
          <Typography variant="body1" fontWeight="bold">
            {results.operatingHours.toFixed(1)} hours
          </Typography>
        </Grid>
      </Grid>

      <Divider sx={{ my: 2 }} />

      {/* Production details */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Items per Print Job</Typography>
          <Typography variant="body1">
            {formatNumber(results.itemsPerPrintJob)} units
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Typography variant="subtitle2">Monthly Print Jobs</Typography>
          <Typography variant="body1">
            {formatNumber(results.monthlyPrintJobs)} jobs
          </Typography>
        </Grid>
      </Grid>

      <Divider sx={{ my: 2 }} />

      {/* Ink usage details */}
      <Typography variant="subtitle2" gutterBottom>
        Ink Usage per Item
      </Typography>
      <Grid container spacing={2} sx={{ mb: 3 }}>
        <Grid item xs={4}>
          <Typography variant="body2">White: {results.inkUsage.white} cc</Typography>
        </Grid>
        <Grid item xs={4}>
          <Typography variant="body2">CMYK: {results.inkUsage.cmyk} cc</Typography>
        </Grid>
        <Grid item xs={4}>
          <Typography variant="body2">Primer: {results.inkUsage.primer} cc</Typography>
        </Grid>
      </Grid>
      <Typography variant="body2">
        Ink Cost per Unit: {formatCurrency(results.inkCostPerUnit)}
      </Typography>

      <Box sx={{ mt: 4, display: 'flex', justifyContent: 'flex-end' }}>
        <Button 
          variant="contained" 
          color="primary"
          disabled={true} // Will be enabled in Phase 2
        >
          Download PDF
        </Button>
      </Box>
    </Box>
  );
};

export default ResultsPanel;
